import {FunctionComponent, ReactNode} from "react";

type NavbarIconsType = {
    color : string
}

export enum NAVBAR_ICONS {
    companies,
    companiesHover,
    team,
    teamHover,
    contacts,
    contactsHover,
    projects,
    projectsHover,
    accounting,
    accountingHover,

    info,
    infoHover,
    invoice,
    invoiceHover,
    book,
    bookHover

}

type GetNavbarIconType = (icon: NAVBAR_ICONS, color: string) => ReactNode

/**
 *Function to create a React element icon for the navbar buttons
 * @param icon  the icon you want in the TOPBAR_ICONS enum
 * @param color color to apply on the icon
 * @return to integer in the JSX
 */
const getNavbarIcon : GetNavbarIconType= (icon, color) =>(
    {
        [NAVBAR_ICONS.companies] : CompaniesNavbarIcons({color}),
        [NAVBAR_ICONS.companiesHover] : CompaniesHoverNavbarIcons({color}),
        [NAVBAR_ICONS.team] : TeamNavbarIcons({color}),
        [NAVBAR_ICONS.teamHover] : TeamHoverNavbarIcons({color}),
        [NAVBAR_ICONS.contacts] : ContactsNavbarIcons({color}),
        [NAVBAR_ICONS.contactsHover] : ContactsHoverNavbarIcons({color}),
        [NAVBAR_ICONS.projects] : ProjectsNavbarIcons({color}),
        [NAVBAR_ICONS.projectsHover] : ProjectsHoverNavbarIcons({color}),
        [NAVBAR_ICONS.accounting] : AccountingNavbarIcons({color}),
        [NAVBAR_ICONS.accountingHover] : AccountingHoverNavbarIcons({color}),
        [NAVBAR_ICONS.info] : InfoNavbarIcons({color}),
        [NAVBAR_ICONS.infoHover] : InfoHoverNavbarIcons({color}),
        [NAVBAR_ICONS.invoice] : InvoiceNavbarIcons({color}),
        [NAVBAR_ICONS.invoiceHover] : InvoiceHoverNavbarIcons({color}),
        [NAVBAR_ICONS.book] : BookNavbarIcons({color}),
        [NAVBAR_ICONS.bookHover] : BookHoverNavbarIcons({color})
    }[icon])

export default getNavbarIcon

